import { Box, VStack, Text,Button,ButtonText, FormControl, FormControlLabel, Input, InputField, FormControlLabelText } from '@gluestack-ui/themed';
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const InserFoodGroups = () => {
    const [formData, setData] = useState({});

    const onSubmit = async () => {
        try{
            axios.post('http://localhost/1.75/backend/public/api/FoodGroupStore', formData)

        }catch(arror){
